        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.geo.cluster.max.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Harita verileri sistem verileri sınırını aştığında görüntülenen maksimum küme sayısını belirtir. Harita verileri, sistem verileri sınırını aşmazsa bu seçeneğin bir etkisi olmaz.</p></section>',
        "vaeua-gui-eua.sas.van.ReportReview.HighReportHeaderObjectCount.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Aşağıdaki sorunu ortadan kaldırmak için rapor istemi alanından denetimleri kaldırın. Örneğin, orta öncelikli sorunları ortadan kaldırmak için, rapor istemi alanındaki denetim sayısını 10 veya daha düşük bir değere indirin.</p><p class\\="xis-paragraph">Orta öncelik\\: rapor istemi alanında 10’dan fazla nesne içerir.</p></section>',
