        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.forceStrength.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Düğümleri ve bağlantıları konumlandırırken, yerel kuvvetlerin, global kuvvetlere olan göreceli kuvvetini belirtir. Düğümler ve bağlantıların düzeni güç ile yönlendirilen algoritma tarafından belirlenir. Algoritma, birlikte çok yakın olmayan düğüm konumlarını ve yaklaşık aynı uzunlukta olan bağlantıları bulur.</p><p class\\="xis-paragraph">Genel olarak, <span class\\="xis-windowItem">Force strength</span> için daha büyük bir değer ağdaki düğümler arasına daha fazla uzaklık ekler.</p></section>',
