        "vaeua-gui-eua.discreteTickValueFitPolicy.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph"><span class\\="xis-windowItem">İşaret değeri görünümü</span> seçeneği onay işareti değerlerini X eksenine sığdırmak için kullanılır. <span class\\="xis-windowItem">Kesişimi otomatik olarak azalt</span> veya <span class\\="xis-windowItem">Sabit yönlendirme</span>’yi seçebilirsiniz.</p><div class\\="xis-paragraph"><span class\\="xis-windowItem">Kesişimi otomatik olarak azalt</span> seçeneği yalnızca işaret değerleri kesiştiğinde uygulanır. Şunları belirtebilirsiniz\\: <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">Kademelendirme, kesme, bırakma</span></td><td>değerleri sırayla yukarı ve aşağı kaydırır, işaret değerlerinden karakterleri kırpar ve ardından işaret değerleri bırakır.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">45° Döndürme</span></td><td>tüm işaret değerlerini çapraz şekilde 45° döndürür.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Kademelendir, kes</span></td><td>işaret değerlerini dönüşümlü olarak yukarı ve aşağı olacak şekilde değiştirir, ardından işaret değerlerinden karakterleri kırpar.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Kes</span></td><td>işaret değerlerinden karakterleri kırpar.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Kesme, 45° döndürme</span></td><td>işaret değerlerinden karakterleri kırpar ve tüm işaret değerlerini çapraz şekilde 45° döndürür.</td></tr></table></div>                 </div><div class\\="xis-paragraph"><span class\\="xis-windowItem">Sabit yönlendirme</span> seçeneği her zaman uygulanır ve değerlere ilişkin yönlendirmeyi ayarlar. Şunları belirtebilirsiniz\\: <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">Yatay</span></td><td>işaret değerlerini yatay olarak gösterir.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">45° Döndürme</span></td><td>tüm işaret değerlerini çapraz şekilde 45° döndürür.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">45° Döndürme, bırakma</span></td><td>tüm işaret değerlerini çapraz şekilde 45° döndürür ve işaret değerleri bırakır.</td></tr></table></div>                 </div></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.identifyTermRoles.help.tip.txt": "Bu seçenek hakkında daha fazla bilgi ",
        "vaeua-gui-eua.Properties.linearRegression.significanceLevel.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Model oluşturmak üzere göz önünde bulundurulan değişkenleri belirlemek üzere hızlı geriye dönük değişken seçimi gerçekleştirir. Yalnızca belirlenen önem düzeyinin altındaki <span class\\="xis-userSuppliedValue">p</span>-değerlerine sahip değişkenler göz önünde bulundurulur.</p></section>',
        "vaeua-gui-eua.sas.van.ReportReview.SlowReportLoad.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Raporunuzun ilk sayfasının yüklenmesi uzun sürüyor. SAS Visual Analytics, yavaş yükleme süresi dışındaki performans sorunlarını belirlerse önce bu sorunları düzeltin. Başka bir performans sorunu belirlenmezse, başka faktörlerin raporunuzu etkileyip etkilemediğini belirlemek için sistem yöneticinizle görüşün. Örneğin, yavaş bağlantı raporun yavaş yüklenmesine neden olabilir.</p><p class\\="xis-paragraph">Düşük öncelik\\: 5 saniye veya daha uzun sürer</p><p class\\="xis-paragraph">Orta öncelik\\: 10 saniye veya daha uzun sürer</p><p class\\="xis-paragraph">Yüksek öncelik\\: 25 saniye veya daha uzun sürer</p></section>',
