        "vaeua-gui-eua.Properties.neuralnetwork.activationlabel.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Yanıtı modellemek için normal dağılım kullanılırken çıktı katmanını oluşturmak için kullanılan etkinleştirme işlevini belirtir. Üslü etkinleştirme fonksiyonu gamma veya Possion dağılımı ile kullanılır. </p></section>',
