        "vaeua-gui-eua.sas.van.control.initialValueSVS.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Kontrol için ilk (varsayılan) değeri belirtir. Başlangıç değeri, bir kullanıcı tarafından rapor ilk kez açıldığında veya <span class\\="xis-windowItem">Varsayılan rapor durumunu geri yükle</span> seçildiğinde belirlenir. </p><div class\\="xis-paragraph">Metin alanına bir değer girin veya aşağıdakilerden birini belirtin\\: <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Otomatik</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">raporu kaydettiğinizde seçiminizin başlangıç değeri olarak kaydedileceğini belirtir. </p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Minimum değer</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple"> kontroldeki en düşük değerin başlangıç değeri olacağını belirtir.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Maksimum Değer</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple"> kontroldeki en yüksek değerin başlangıç değeri olacağını belirtir.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-userSuppliedValue">parametre-adı</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">seçtiğiniz parametrenin değerinin denetim için başlangıç ​​değeri olduğunu belirtir.</p><p class\\="xis-paraSimple">Yalnızca uygun veri türüne sahip bir parametre mevcutsa parametre seçimi yapabilirsiniz.</p></dd></dl></div>                 </div></section>',
