        "vaeua-gui-eua.sas.van.ReportReview.LowPercentageUsedColumns.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Aşağıdaki sorunu ortadan kaldırmak için raporun veri kaynağındaki kullanılmayan sütunları kaldırın. Örneğin, düşük öncelikli sorunları ortadan kaldırmak için, raporunuzun veri kaynağındaki sütunların en az %10’unu kullandığından emin olun.</p><p class\\="xis-paragraph">Düşük öncelik\\: bir veri kaynağında 100 veya daha fazla sütun olduğunda sütunların en fazla %10’unu kullanır</p></section>',
        "vaeua-gui-eua.sas.van.Properties.object.title.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Otomatik başlık seçeneği, anahtar değeri gibi bazı nesnelere uygulanamayabilir.</p></section>',
        "vaeua-gui-eua.Properties.factmac.learnStep.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">SGD algoritması için öğrenme adımı boyutunu belirtir. Daha yavaş öğrenme modelin aşırı öğrenmesini engeller. Optimizasyon algoritmasının verimli şekilde yakınsamasını sağlamak için öğrenme adımı değeri ayarlanabilir.</p></section>',
