        "vaeua-gui-eua.Properties.bayesNet.treeAugmentedNaive.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Yanıt değişkeninden her bir öngörücüye doğrudan bağlantı içeren, ağaç artırılmış naive Bayesian ağı ve öngörücüler arasında bir ağaç yapısı oluşturmaya çalışır. Ağaç artırılmış naive Bayesian ağları için maksimum üst öğe sayısının her zaman iki olması gerekir.</p></section>',
