        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.maxNodeCount.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Ağ düzeninin ayrıntı düzeyini belirtir.</p></section>',
        "vaeua-gui-eua.Properties.bayesNet.parentChild.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Naive Bayesian ağını genişleten bir üst-alt Bayesian ağı oluşturmaya çalışır. Bu uzantı, öngörücülerin, yanıt değişkeninin üst öğesi olmasına olanak sağlar, yanıt değişkeninin üst ve alt öğeleri arasında ve yanıt değişkeninin alt öğeleri arasında bağlantı oluşturur.</p></section>',
