        "vaeua-gui-eua.ModelComparisonBasePropertiesView.percentile.field.label.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Belirli istatistikleri hesaplamak için kullanılan yüzdebirlik binlerin derinliğini belirtir. Bu istatistiklerin arasında gözlemlenen ortalama, lift, kümülatif lift, yakalanan kümülatif yüzde ve olayların kümülatif yüzdesi yer alır.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.linkType.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Düğümler arasındaki bağlantıların yönlendirilmiş (tek yönlü) veya yönsüz (çift yönlü) olup olmadığını belirtir. Bağlantı türü, ağ ölçümlerinin hesaplanmasını etkiler. Bağlantı okları görüntülendiğinde, bağlantı türü, bağlantı oklarının yönünü belirler.</p></section>',
