        "vaeua-gui-eua.linearTickValueFitPolicy.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph"><span class\\="xis-windowItem">İşaret değeri görünümü</span> seçeneği onay işareti değerlerini X eksenine sığdırmak için kullanılır. <span class\\="xis-windowItem">Kesişimi otomatik olarak azalt</span> veya <span class\\="xis-windowItem">Sabit yönlendirme</span>’yi seçebilirsiniz.</p><div class\\="xis-paragraph"><span class\\="xis-windowItem">Kesişimi otomatik olarak azalt</span> seçeneği yalnızca işaret değerleri kesiştiğinde uygulanır. Şunları belirtebilirsiniz\\: <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">Bazılarını bırak</span></td><td>bazı işaret değerlerini bırakır.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">45° Döndürme</span></td><td>tüm işaret değerlerini çapraz şekilde 45° döndürür.</td></tr></table></div>                 </div><div class\\="xis-paragraph"><span class\\="xis-windowItem">Sabit yönlendirme</span> seçeneği her zaman uygulanır ve değerlere ilişkin yönlendirmeyi ayarlar. Şunları belirtebilirsiniz\\: <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">Yatay</span></td><td>işaret değerlerini yatay olarak gösterir.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">45° Döndürme</span></td><td>tüm işaret değerlerini çapraz şekilde 45° döndürür.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">45° Döndürme, bırakma</span></td><td>tüm işaret değerlerini çapraz şekilde 45° döndürür ve ardından işaret değerleri bırakır.</td></tr></table></div>                 </div></section>',
