        "vaeua-gui-eua.Properties.linearRegression.includeMissing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Modeli, eksik değerleri olan gözlemleri kapsayacak şekilde genişletir. Gözlemlenen ortalama ile birlikte sürekli bir etki atfedilir ve eksikliği gösteren bir indikatör değişkeni oluşturulur. Sınıflandırma efekti eksik değerleri ayrı bir düzey olarak işleme alır. </p></section>',
