        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.cluster.nClusters.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Oluşturulacak kümelerin sayısını belirtir veya ideal küme sayısını belirlemek için hizalı kutu kriterinin (ABC) kullanılması gerektiğini belirtir.</p><p class\\="xis-paragraph">ABC yöntemi önce oluşturulacak bir küme sayısı seçer, kümeleri oluşturur ve her küme için boşluk istatistiğini hesaplar. Sonra, her bir küme için bir referans dağıtımı oluşturulur ve her bir referans dağıtımı için boşluk istatistiği hesaplanır. Bu işlem, olası küme sayılarının tümü için tekrar edilir. Kümelerin boşluk istatistikleri ile referans verileri arasındaki toplam farkı en yüksek tutan küme sayısı, ideal küme sayısı olarak seçilir.</p><p class\\="xis-paragraph">ABC yöntemi, yalnızca tüm girdiler ölçüm değişkenleri olduğunda geçerlidir.</p></section>',
        "vaeua-gui-eua.sas.van.ReportReview.HighCustomCategoryEntries.help.tip.txt": "Bu seçenek hakkında daha fazla bilgi ",
