        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.forest.usedefaultvariable.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Her ayrım için denenecek varsayılan öngörücü sayısını kullanır. Varsayılan toplam öngörücü sayısının kareköküdür. Aksi takdirde, her ayrım için denenecek öngörücü sayısını belirtin.</p></section>',
        "vaeua-gui-eua.Properties.partialdependence.numBins.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Kısmi Bağımlılık çiziminde ölçüm değişkenlerini kategorilere ayırmak için kullanılacak bölme sayısını belirtir.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.rapidGrowth.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Hızlı k-ortalamalar kümesi algoritmasını etkinleştirir ve bin sıralamasını göz ardı eder. Hızlı arama algoritmasını kullanmak ve bin sıralamasını dikkate almak istiyorsanız bu seçeneği işaretlemeyin. Bölünmemiş ölçüm yanıtları seçim kriteri olarak varyans kullanır. Bu seçenek seçildiğinde, kategori yanıtları ve bölünmüş ölçüm yanıtları kazanım oranını kullanın. Aksi takdirde, mutlak kazanım kullanılır.</p></section>',
