        "vaeua-gui-eua.Properties.bayesNet.naive.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Bir naive Bayesian ağı ve Bayesian ağı artırılmış Bayesian ağı oluşturmaya çalışır. Naive Bayesian ağı, tüm öngörücüler için tek üst öğenin yanıt değişkeni olduğunu belirtir. Yanıt değişkeni belirtildiğinde, tüm öngörücülerin koşullu bağımsızlığını varsayar. Bayesian ağı artırılmış naive Bayesian ağı, öngörücü düğümlerinin bir Bayesian ağı oluşturmasına olanak sağlayarak naive ağını genişletir.</p></section>',
