        "vaeua-gui-eua.sas.van.ShareDialog.embeddableLink.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Nesne veya raporun bir web sayfasına katıştırılabilmesi için HTML özel sekmeleri oluşturur.</p><p class\\="xis-paragraph">Web sayfanızda özel etiketleri etkinleştirmek için sayfa başlığınıza &lt;script&gt; etiketleri de eklemeniz gerekir. SAS Visual Analytics içeriğini katıştırma hakkında daha fazla bilgi için bkz. <a href\\="https\\://developer.sas.com/sdk/va/docs/getting-started/" target\\="_blank" rel\\="noopener noreferrer">SAS Visual Analytics SDK belgeleri</a>.</p></section>',
        "vaeua-gui-eua.clusterSpacing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph"><span class\\="xis-windowItem">Küme aralığı</span> seçeneği, gruplanmış çubuklar için kümeler arasındaki aralığın genişliğini kontrol eder. Çubuklar arasındaki boşluğu değiştirmek istiyorsanız <span class\\="xis-windowItem">Aralık</span> seçeneğini belirleyin.</p></section>',
