        "vaeua-gui-eua.sas.van.control.initialMaxValue.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Kontrol için maksimum başlangıç değerini (üst sınır) belirtir. Başlangıç değeri, bir kullanıcı tarafından rapor ilk kez açıldığında veya <span class\\="xis-windowItem">Varsayılan rapor durumunu geri yükle</span> seçildiğinde belirlenir. </p><div class\\="xis-paragraph">Metin alanına bir değer girin veya aşağıdakilerden birini belirtin\\: <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Otomatik</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">raporu kaydettiğinizde seçiminizin başlangıç değeri olarak kaydedileceğini belirtir. </p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Maksimum Değer</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">kontroldeki en yüksek değerin başlangıç değeri olacağını belirtir.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-userSuppliedValue">parametre-adı</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">seçtiğiniz parametrenin değerinin denetim için başlangıç ​​değeri olduğunu belirtir.</p><p class\\="xis-paraSimple">Yalnızca uygun veri türüne sahip bir parametre mevcutsa parametre seçimi yapabilirsiniz.</p></dd></dl></div>                 </div></section>',
        "vaeua-gui-eua.Properties.bayesNet.prescreenPredictors.help.aria.txt": "Yardım. Bu seçenek hakkında daha fazla bilgi ",
        "vaeua-gui-eua.react.va.geo.search.includeTraffic.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">Grafik özelliğinin yolculuk süresinin hesaplanması için trafiğin nasıl kullanıldığını belirtir. Aşağıdaki seçeneklerden birini belirleyin\\: <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Hayır</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">Seyahat süresi hesaplamasında haftanın her günü ve günün her saati için geçmiş trafik verilerinin ağırlıklı ortalamasının kullanılacağını belirtir.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Güncel trafik</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">Seyahat süresi hesaplamasında güncel trafik koşullarının kullanılacağını belirtir. Bu trafik verileri <span data-icon-name\\="refresh" alt\\="Trafik verilerini güncelle simgesine" aria-label\\="Trafik verilerini güncelle simgesine"></span> tıklanarak güncellenebilir. Bir kullanıcı raporu görüntülediğinde trafik otomatik olarak güncellenmez. Kullanıcı, en güncel trafik koşullarını yansıtmak için trafik verilerini güncellemelidir.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Tipik trafik</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple"> yolculuk süresi hesaplamasının haftanın belirtilen gün ve saati için tipik olan trafiği kullandığını belirtir. Tipik trafik koşulları yakın geçmiş verilerini temel alır.</p><div class\\="xis-note"><span class\\="xis-noteGenText">Not\\:</span> Belirttiğiniz saat, haritadaki konum için yerel saattir.</div></dd></dl></div>                 </div><div class\\="xis-note"><span class\\="xis-noteGenText">Not\\:</span>Yolculuk süresi verilerini almak Esri Premium Services kredisi tüketir.</div><div class\\="xis-note"><span class\\="xis-noteGenText">Not\\:</span>Yolculuk süresi hesaplamasını içeren bölge için kullanılabilen trafik verisi yoksa, yolculuk süresini hesaplamak için resmi hız sınırları kullanılır.</div></section>',
