        "vaeua-gui-eua.Properties.neuralnetwork.validateError.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Model çalıştırmasını tamamlamak için kabul edilebilir maksimum doğrulama hatasını belirtir. Doğrulama hatası belirtilen hedef değerinden az olduğunda, model çalıştırması sonlandırılır.</p></section>',
