        "vaeua-gui-eua.Distribution.label.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Yanıt değişkenini modellemek için kullanılan dağılım işlevini belirler.</p></section>',
        "vaeua-gui-eua.dataElementStyleRotation.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph"><span class\\="xis-windowItem">Veri öğesi stili döndürme</span> seçeneği, grafik şablonundaki veri öğelerine stillerin nasıl atanacağını belirtir. Örneğin bir çizgi grafiğinde bu seçenek, grafikteki çizgileri birbirinden ayırmak için renklerin, çizgi desenlerinin ve işaretçilerin nasıl kullanılacağını belirtir. <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Otomatik</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">temadan stil döndürme ayarını kullanır. Çoğu SAS teması, <span class\\="xis-windowItem">Önce tüm renkleri döndür</span> ayarını kullanır. Yüksek Karşıtlık teması, <span class\\="xis-windowItem">Tüm öznitelikleri döndür</span> ayarını kullanır.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Önce tüm renkleri döndür</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">paletteki tüm renkler kullanılana kadar düz bir dolgu, düz çizgi ve tutarlı bir işaretçi şekli görüntüler.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Tüm öznitelikleri döndür</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">farklı renklere ek olarak farklı dolgu desenleri, çizgi desenleri ve işaretçi şekilleri görüntüler. Bu ayar, renkleri algılamada zorlanan (renk körlüğü olan) kullanıcılar için erişilebilirliği iyileştirebilir.</p></dd></dl></div>                 </div></section>',
        "vaeua-gui-eua.sas.van.ShareDialog.useGuestAccess.help.aria.txt": "Yardım. Bu seçenek hakkında daha fazla bilgi ",
        "vaeua-gui-eua.Properties.svm.sigmoidParameterOne.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Sigmoid fonksiyonundaki ölçek (katsayı) parametresini belirler.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.communities.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Her düğüm kümesinde hesaplanacak toplulukların (yerel düğüm grupları) sayısını belirtir. Ağ yapısını ve büyüklüğüne bağlı olarak, hesaplanan toplam topluluk sayısının, seçilen değerden az olabileceğini aklınızda bulundurun.</p></section>',
