        "vaeua-gui-eua.Properties.bayesNet.includeMissing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Kategorik öngörücüler eksik değeri ayrı bir değer olarak kabul eder. Sürekli öngörücü, öngörücü aracılığıyla eksik bir değerin yerini alır. Bayesian ağlarda, eksik değerler yanıt değişkenine dahil edilmez.</p></section>',
