        "vaeua-gui-eua.Properties.svm.defaultpenalty.help.tip.txt": "Bu seçenek hakkında daha fazla bilgi ",
        "vaeua-gui-eua.groupingScale.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph"><span class\\="xis-windowItem">Gruplandırma ölçeği</span> seçeneği, gruplanan çubuk grafiklerin nasıl ölçekleneceğini belirler. Çubuklar yığılı veya kümelenmiş şekilde ölçeklenebilir. <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Gerçek değerler</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">çubukları verilerdeki değerleri temel alarak boyutlandırır. Örneğin, bir gruptaki çubuğun 50 değerine, başka bir gruptaki çubuğun ise 500 değerine sahip olduğunu varsayalım. 500 çubuğu, 50 çubuğundan 10 kat uzun olurdu.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Grupları %100 olarak normalleştir</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">grupları bir göreli ölçek kullanarak sunar. Grup içinde, her bir çubuk gruba ait bir yüzdesel değer olarak görüntülenir. Örneğin, bir grubun toplam 100 değerine sahip olduğunu varsayalım. Bu grup içindeki çubuk 50 değerine sahipse çubuk, genel grubun %50 yüksekliğindedir.</p></dd></dl></div>                 </div><p class\\="xis-paragraph">Grafik nesnesinde yer paylaşımlı grafik öğelerinin mevcut olması halinde bu seçenek kullanılamaz. Bir kafes içindeki eksenler için aynı veri aralığını belirtmeniz halinde de bu seçenek kullanılamaz.</p></section>',
